import React from 'react';
import trashicon from "../static/trash.jpeg";
import "../index.css";

const TrashIcon = () => {
    return (
      <div className="image-div">
        <img className="image" src={trashicon} alt="Trash" />
      </div>
    );
}
export default TrashIcon;
